// Create a map instance
var chart = am4core.create("chartdiv", am4maps.MapChart);
// Set the desired zoom level
chart.homeZoomLevel = 3;
// Set the initial map position using latitude and longitude
chart.homeGeoPoint = {latitude: 52.2, longitude: 28};
// Set projection
chart.projection = new am4maps.projections.Miller();

//Title
var title = chart.titles.create();
title.text = "Click a country";
title.fontSize = 30;
title.align = "left";
title.padding(5, 5, 5, 5);
title.y = "20em";
title.marginLeft = "20%";
// Set map definition
chart.geodata = am4geodata_worldHigh;

// Add reset button
var reset_button = chart.chartContainer.createChild(am4core.Button);
reset_button.label.text = "Reset";
reset_button.padding(5, 5, 5, 5);
// button.width = 400;
reset_button.align = "left";
reset_button.marginLeft = "10em";
reset_button.position = 'relative';
reset_button.left = '500';
reset_button.events.on("hit", function() {
  chart.goHome();
  polygonSeries.data = [0];
  title.text = "Click a country";
});


// Select relationship button xlikesy
var xlikesybutton = chart.chartContainer.createChild(am4core.Button);
xlikesybutton.label.text = "X Likes Y";
xlikesybutton.padding(5, 5, 5, 5);
// button.width = 400;
xlikesybutton.align = "left";
xlikesybutton.marginLeft = '70em';
xlikesybutton.position = 'relative';
xlikesybutton.on = 'true';
// xlikesybutton.background.fill = am4core.color('green');
xlikesybutton.events.on("hit", function() {
    xlikesybutton.on = 'true';
    xlikedbyybutton.on = 'false';
    
    // xlikesybutton.background.fill = am4core.color('green');
    // xlikedbyybutton.background.fill = am4core.color('red');
  });

xlikesybutton.events.on("over", function() {
    // xlikesybutton.background.fill = am4core.color('green');
  });

