//   });

// Select relationship button x liked by
var xlikedbyybutton = chart.chartContainer.createChild(am4core.Button);
xlikedbyybutton.label.text = "X Liked by Y";
xlikedbyybutton.padding(5, 5, 5, 5);
// button.width = 400;
xlikedbyybutton.align = "left";
xlikedbyybutton.marginLeft = '160em';
xlikedbyybutton.position = 'relative';
xlikedbyybutton.on = 'false';
// xlikedbyybutton.background.fill = am4core.color('green');
xlikedbyybutton.events.on("hit", function() {
    xlikedbyybutton.on = 'true';
    xlikesybutton.on = 'false';
    // xlikedbyybutton.background.fill = am4core.color('green');
    // xlikesybutton.background.fill = am4core.color('red');
  });
xlikedbyybutton.events.on("over", function() {
    // xlikedbyybutton.background.fill = am4core.color('green');
  });


// Create map polygon series
var polygonSeries = chart.series.push(new am4maps.MapPolygonSeries());
polygonSeries.useGeodata = true;

// Exclude Antartica
polygonSeries.exclude = ["AQ"];

// Configure series
var polygonTemplate = polygonSeries.mapPolygons.template;

//Basic map color
polygonTemplate.fill = am4core.color("#cccccc");

// Add a heat rule to colorize countries based on data
polygonSeries.heatRules.push({
    property: "fill",
    target: polygonTemplate,
    
    min: am4core.color("#FF0000"),
    max: am4core.color("#00FF00"),
    minValue: -5,
    maxValue: 5
});

// Set up a tooltip
polygonSeries.tooltip.getFillFromObject = false;
polygonSeries.tooltip.background.fill = am4core.color("#bbbbbb");
polygonSeries.tooltip.label.interactionsEnabled = true;

// Set data for the map
polygonSeries.data = [];

// Set up tooltips
polygonTemplate.tooltipText = "{name}: {value}";

// Create hover state and set alternative fill color
var hs = polygonTemplate.states.create("hover");
hs.properties.fill = am4core.color("#000000");

var activestate = polygonTemplate.states.create("active");
activestate.properties.fill = am4core.color("#000000");

